import { getPopulatedArray } from "../../lib";
import jsPDF from 'jspdf';
import 'jspdf-autotable';


var getImageFromUrl = function(url, callback) {
	var img = new Image();

	img.onError = function() {
		alert('Cannot load image: "'+url+'"');
	};
	img.onload = function() {
		callback(img);
	};
	img.src = url;

    return img
}


export const exportToPDFAlternate = (name, rows, columns) => {
    let now = new Date();
    let doc = new jsPDF({ orientation: "l" });

    doc.setFontSize(18);

    let imgData = ""

    doc.addImage(imgData, 'JPEG', 20, 3, 30, 10, 'SWAN Humaniterian Consortium');

    doc.setFont("helvetica");
    doc.text(
        "" + name, 60, 10
    );

    doc.setFontSize(8);

    // console.log(columns.map(x => x.key))

    doc.autoTable({
        head: [columns.map(x => x.title)],
        body: rows,
        theme: "striped",
        didDrawCell: (data) => { },
    });

    doc.save(
        `SWAN ${name} ${now.getFullYear()}-${now.getMonth()}-${now.getDate()} T${now.getHours()}-${now.getMinutes()}-${now.getSeconds()}.pdf`
    );
}